import KakaoMap from "./KakaoMap.js"
const { kakao } = window; // 카카오 api 에서 사용하는 변수들을 리엑트가 알 수 있음


export default function MapPage({ logo }) {
  useEffect(() => {
    KakaoMap();
  }, []);


  //   console.log(kakao);
  return (
    <div className="main">
      <section className="top">상단 bar</section>
      <body className="inner">
        <div className="side">
          <div className="myinfo">내정보</div>
          <ul>
            <li>내 위치</li>
            <button type="button" onClick>내 현재 위치</button>
            <li>친구1</li>
            <li>친구2 (map함수)</li>
          </ul>
          <button>re meet</button>
        </div>
        <div className="map">
          <div>
            <div id="map" style={{ width: "500px", height: "400px" }}></div>
          </div>
        </div>
      </body>
    </div>
  );
}
